import { useState } from 'react';




function Login(){


const [email, setEmail] = useState("");
const [pass, setPass] = useState("");

  return (
    <div className='login'>
        <h1 className='menu'>Login</h1>
            <input className='menu' type="text" name="" id="" placeholder='Enter your Email' onClick={(e)=>{setEmail=e.target.value}} />
            <input className='menu' type="text" name="" id="" placeholder='Enter your password' onClick={(e)=>{setPass=e.target.value}} />
            <button className='menu'>Login</button>
    </div>
  );
}

export default Login;
